import org.apache.commons.io.FileUtils;
import org.apache.tika.Tika;
import org.jzb.J;
import org.jzb.img.JImg;

import javax.imageio.ImageIO;
import javax.imageio.ImageReader;
import java.awt.image.BufferedImage;
import java.io.File;
import java.nio.file.Files;
import java.util.Iterator;

import static org.jzb.execution.Constant.UPLOAD_TMP_PATH;

/**
 * 描述：
 *
 * @author jzb 2017-11-13
 */
public class Base64Image2world {
    // static String s = "data:image/png;base64,";

    public static void main(String[] args) throws Exception {
        // byte[] decodedImg = Base64.getDecoder().decode(s.getBytes(StandardCharsets.UTF_8));
        // System.out.println(decodedImg);
        String s = "data:image/png;base64,";

        final BufferedImage bufferedImage = JImg.base64(s);
        File file = FileUtils.getFile(UPLOAD_TMP_PATH, J.uuid58());
        ImageIO.write(bufferedImage, "jpg", file);

        System.out.println(Files.probeContentType(file.toPath()));
        System.out.println(new Tika().detect(file));

        // final ImageInputStream is = ImageIO.createImageInputStream(bufferedImage);
        Iterator<ImageReader> imageReaders = ImageIO.getImageReaders(file);
        while (imageReaders.hasNext()) {
            ImageReader reader = imageReaders.next();
            System.out.printf("formatName: %s%n", reader.getFormatName());
        }
    }
}
